description:
Surubul autoforant pentru tigla metalica este realizat din otel carbon electrogalvanizat si are dimensiunile 4.8 x 20 mm.
Acesta include saiba de otel si garnitura EPDM.
Informatii suplimentare:
Tip hexagon: 8 mm;
Tip garnitura: Z14;
Compatibilitate unealta electrica: maximum 1800 rpm;
Unitate de ambalare: cutie.
